import React from "react";
import { robots } from "./robots";
import CardList from "./CardList";
import Searchbox from "./Searchbox";

const state = {
  robots: robots,
  searchfield: "",
};
const App = () => {
  return (
    <div className='tc'>
      <h1>RoboFriends</h1>
      <Searchbox />
      <CardList robots={robots} />;
    </div>
  );
};

export default App;
